import React from 'react';
import './Styles.css';

function Locations() {
  return (
    <div className="mainSpace">
      <center>
        <h1>Locations</h1>
        Prefer the smell and environment of a real bookstore? We have several
        locations across the states! Revature's Digest is located at 11730 Plaza
        America Dr. 2nd Floor Reston, VA
      </center>
    </div>
  );
}

export default Locations;
